import React from 'react';

const AboutUs = () => {
    return (
        <div className="about-us">
            <h1>About PT Fachri Property Group</h1>
            <p>
                PT Fachri Property Group is dedicated to providing exceptional real estate services. 
                Our mission is to help clients find their dream properties while ensuring a seamless 
                and enjoyable experience. With years of expertise in the industry, we pride ourselves 
                on our commitment to excellence and customer satisfaction.
            </p>
            <h2>Our Achievements</h2>
            <ul>
                <li>Over 500 successful property transactions.</li>
                <li>Awarded "Best Real Estate Agency" in 2022.</li>
                <li>Trusted by clients for our integrity and professionalism.</li>
            </ul>
        </div>
    );
};

export default AboutUs;
